import React from "react";
import {
  StyledNavHeader,
  StyledNavContent,
  StyledLogo,
  StyledLinks,
  StyledLinkItems,
  StyledSignIn,
  SignOutButton,
  StyledSignOut,
  Username,
} from "./Navbar.styled";
import { Container } from "../../../Styles/CommonStyles/Container";

export const Navbar = () => {
  return (
    <StyledNavHeader>
      <Container>
        <StyledNavContent>
          <StyledLogo>
            <StyledLinks>
              <StyledLinkItems>Home</StyledLinkItems>
              <StyledLinkItems>Movies</StyledLinkItems>
            </StyledLinks>
          </StyledLogo>
        </StyledNavContent>
      </Container>
    </StyledNavHeader>
  );
};
